import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faChartBar, faBox, faClipboardList, faUsers, faPlus, faAngleDown, faUserCog, faUserPlus, faUserCircle } from '@fortawesome/free-solid-svg-icons';
import './Sidebar.css'; // Importing CSS file for styling

const Sidebar = ({ adminName }) => {
  const [title, setTitle] = React.useState('Admin Dashboard');
  const [showAdminMenu, setShowAdminMenu] = React.useState(false);
  const navigate = useNavigate(); // Use useNavigate hook

  const handleItemClick = (newTitle) => {
    setTitle(newTitle);
  };

  const toggleAdminMenu = () => {
    setShowAdminMenu(!showAdminMenu);
  };

  return (
    <div className="sidebar">
      <h2>{title}</h2>
      <div className="admin-name">{adminName}</div> {/* Display admin's name */}
      <ul>
        <li onClick={() => handleItemClick('Dashboard')}>
          <span onClick={() => navigate(`/dashboard?adminName=${encodeURIComponent(adminName)}`)}>
            <FontAwesomeIcon icon={faChartBar} />
            <span>Dashboard</span>
          </span>
        </li>
        <li onClick={() => handleItemClick('Products')}>
          <span onClick={() => navigate(`/products?adminName=${encodeURIComponent(adminName)}`)}>
            <FontAwesomeIcon icon={faBox} />
            <span>Products</span>
          </span>
        </li>
        <li onClick={() => handleItemClick('Orders')}>
          <span onClick={() => navigate(`/orders?adminName=${encodeURIComponent(adminName)}`)}>
            <FontAwesomeIcon icon={faClipboardList} />
            <span>Orders</span>
          </span>
        </li>
        <li onClick={() => handleItemClick('Farmers')}>
          <span onClick={() => navigate(`/farmer?adminName=${encodeURIComponent(adminName)}`)}>
            <FontAwesomeIcon icon={faUserCircle} />
            <span>Farmers</span>
          </span>
        </li>
        <li onClick={() => handleItemClick('Customers')}>
          <span onClick={() => navigate(`/customers?adminName=${encodeURIComponent(adminName)}`)}>
            <FontAwesomeIcon icon={faUsers} />
            <span>Customers</span>
          </span>
        </li>
        <li className="admin-dropdown" onClick={toggleAdminMenu}>
          <div>
            <FontAwesomeIcon icon={faUserCog} />
            <span>Admin Management</span>
            <FontAwesomeIcon icon={faAngleDown} className={showAdminMenu ? 'icon-rotate' : ''} />
          </div>
        </li>
        {showAdminMenu && (
          <li>
            <ul className="submenu">
              <li onClick={() => handleItemClick('Admins')}>
                <span onClick={() => navigate(`/admins?adminName=${encodeURIComponent(adminName)}`)}>
                  <FontAwesomeIcon icon={faUsers} />
                  <span>Admins</span>
                </span>
              </li>
              <li onClick={() => handleItemClick('Create')}>
                <span onClick={() => navigate(`/create?adminName=${encodeURIComponent(adminName)}`)}>
                  <FontAwesomeIcon icon={faUserPlus} />
                  <span>Create</span>
                </span>
              </li>
            </ul>
          </li>
        )}
      </ul>
    </div>
  );
};

export default Sidebar;
